import React from 'react';
import './App.css';

class App extends React.Component {


    render() {
        return (
            <div>
                <form>
                    <label>Decimal Number</label>
                    <input type="text" value={this.state.data} onChange={this.updateState}/>

                    <h1>{ this.state.data}</h1>
                </form>
            </div>
        );
    }
}

export default App;
